import React from 'react'
import { useSelector } from 'react-redux';
import '../../normalize.scss'
import '../../base.scss'
import InitCadastro from '../../components/Cadastro/InicioDoCadastro'
import View from "../view/view"

function Cadastro() {
  const user = useSelector(state => state.user.data);

  function renderCadastro() { 
    <View public={true}>
      <InitCadastro/>
    </View>
  }

  function hasCadastro() {
      alert("Você já possui cadastro");
  }

  const direction = (user === true) ? (hasCadastro) : (renderCadastro()) 

  return (
    <React.Fragment>
    {/* <View public={true}>
      <InitCadastro/>
    </View> */}
    { direction }
    </React.Fragment>
  )
}

export default Cadastro
